__NUXT_JSONP__("/api/configuration-transition", {data:[{},{path:"\u002Fzh\u002Fapi\u002Fconfiguration-transition",section:"api",page:{attrs:{title:"API: transition 属性配置",description:"用于设置页面切换过渡效果的默认属性值。"},body:"\u003Ch1 id=\"transition-属性配置\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#transition-属性配置\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003Etransition 属性配置\u003C\u002Fh1\u003E\u003Cul\u003E\n\u003Cli\u003EType: \u003Ccode\u003EString\u003C\u002Fcode\u003E 或 \u003Ccode\u003EObject\u003C\u002Fcode\u003E\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\u003Cblockquote\u003E\n\u003Cp\u003E用于设置页面切换过渡效果的默认属性值。\u003C\u002Fp\u003E\n\u003C\u002Fblockquote\u003E\n\u003Cp\u003E默认值：\u003C\u002Fp\u003E\n\u003Cpre\u003E\u003Ccode class=\"hljs js\"\u003E{\n  \u003Cspan class=\"hljs-attr\"\u003Ename\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-string\"\u003E&#x27;page&#x27;\u003C\u002Fspan\u003E,\n  \u003Cspan class=\"hljs-attr\"\u003Emode\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-string\"\u003E&#x27;out-in&#x27;\u003C\u002Fspan\u003E\n}\u003C\u002Fcode\u003E\u003C\u002Fpre\u003E\u003Cp\u003E例如 (\u003Ccode\u003Enuxt.config.js\u003C\u002Fcode\u003E)：\u003C\u002Fp\u003E\n\u003Cpre\u003E\u003Ccode class=\"hljs js\"\u003E\u003Cspan class=\"hljs-built_in\"\u003Emodule\u003C\u002Fspan\u003E.exports = {\n  \u003Cspan class=\"hljs-attr\"\u003Etransition\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-string\"\u003E&#x27;page&#x27;\u003C\u002Fspan\u003E\n  \u003Cspan class=\"hljs-comment\"\u003E\u002F\u002F or\u003C\u002Fspan\u003E\n  \u003Cspan class=\"hljs-attr\"\u003Etransition\u003C\u002Fspan\u003E: {\n    \u003Cspan class=\"hljs-attr\"\u003Ename\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-string\"\u003E&#x27;page&#x27;\u003C\u002Fspan\u003E,\n    \u003Cspan class=\"hljs-attr\"\u003Emode\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-string\"\u003E&#x27;out-in&#x27;\u003C\u002Fspan\u003E,\n    beforeEnter (el) {\n      \u003Cspan class=\"hljs-built_in\"\u003Econsole\u003C\u002Fspan\u003E.log(\u003Cspan class=\"hljs-string\"\u003E&#x27;Before enter...&#x27;\u003C\u002Fspan\u003E);\n    }\n  }\n}\u003C\u002Fcode\u003E\u003C\u002Fpre\u003E\u003Cp\u003E\u003Ccode\u003Etransition\u003C\u002Fcode\u003E 用于设置页面切换过渡效果的默认属性值。想了解当 \u003Ccode\u003Etransition\u003C\u002Fcode\u003E 的值为对象类型时有哪些可用的属性，请参考 \u003Ca href=\"\u002Fapi\u002Fpages-transition#object\"\u003E页面过渡效果配置\u003C\u002Fa\u003E。\u003C\u002Fp\u003E\n\u003Ch1 id=\"layouttransition-属性\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#layouttransition-属性\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003ElayoutTransition 属性\u003C\u002Fh1\u003E\u003Cul\u003E\n\u003Cli\u003E类型: \u003Ccode\u003EString\u003C\u002Fcode\u003E 或 \u003Ccode\u003EObject\u003C\u002Fcode\u003E\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\u003Cblockquote\u003E\n\u003Cp\u003E用于设置布局过渡的默认属性。配置与 \u003Ccode\u003Elayout\u003C\u002Fcode\u003E 相同\u003C\u002Fp\u003E\n\u003C\u002Fblockquote\u003E\n\u003Cp\u003E默认:\u003C\u002Fp\u003E\n\u003Cpre\u003E\u003Ccode class=\"hljs js\"\u003E{\n  \u003Cspan class=\"hljs-attr\"\u003Ename\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-string\"\u003E&#x27;layout&#x27;\u003C\u002Fspan\u003E,\n  \u003Cspan class=\"hljs-attr\"\u003Emode\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-string\"\u003E&#x27;out-in&#x27;\u003C\u002Fspan\u003E\n}\u003C\u002Fcode\u003E\u003C\u002Fpre\u003E\u003Cp\u003E例如 (\u003Ccode\u003Enuxt.config.js\u003C\u002Fcode\u003E):\u003C\u002Fp\u003E\n\u003Cpre\u003E\u003Ccode class=\"hljs js\"\u003E\u003Cspan class=\"hljs-keyword\"\u003Eexport\u003C\u002Fspan\u003E \u003Cspan class=\"hljs-keyword\"\u003Edefault\u003C\u002Fspan\u003E {\n  \u003Cspan class=\"hljs-attr\"\u003ElayoutTransition\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-string\"\u003E&#x27;layout&#x27;\u003C\u002Fspan\u003E\n  \u003Cspan class=\"hljs-comment\"\u003E\u002F\u002F or\u003C\u002Fspan\u003E\n  \u003Cspan class=\"hljs-attr\"\u003Etransition\u003C\u002Fspan\u003E: {\n    \u003Cspan class=\"hljs-attr\"\u003Ename\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-string\"\u003E&#x27;layout&#x27;\u003C\u002Fspan\u003E,\n    \u003Cspan class=\"hljs-attr\"\u003Emode\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-string\"\u003E&#x27;out-in&#x27;\u003C\u002Fspan\u003E\n  }\n}\u003C\u002Fcode\u003E\u003C\u002Fpre\u003E\u003Cp\u003E全局配置示例 \u003Ccode\u003Ecss\u003C\u002Fcode\u003E:\u003C\u002Fp\u003E\n\u003Cpre\u003E\u003Ccode class=\"hljs css\"\u003E\u003Cspan class=\"hljs-selector-class\"\u003E.layout-enter-active\u003C\u002Fspan\u003E, \u003Cspan class=\"hljs-selector-class\"\u003E.layout-leave-active\u003C\u002Fspan\u003E {\n  \u003Cspan class=\"hljs-attribute\"\u003Etransition\u003C\u002Fspan\u003E: opacity .\u003Cspan class=\"hljs-number\"\u003E5s\u003C\u002Fspan\u003E\n}\n\u003Cspan class=\"hljs-selector-class\"\u003E.layout-enter\u003C\u002Fspan\u003E, \u003Cspan class=\"hljs-selector-class\"\u003E.layout-leave-active\u003C\u002Fspan\u003E {\n  \u003Cspan class=\"hljs-attribute\"\u003Eopacity\u003C\u002Fspan\u003E: \u003Cspan class=\"hljs-number\"\u003E0\u003C\u002Fspan\u003E\n}\u003C\u002Fcode\u003E\u003C\u002Fpre\u003E"},contributors:[{author:"warriorBrian"},{author:"Atinux"}]}],fetch:[],mutations:[]});